  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Flint
  Hills National Wildlife Refuge and Marais Des Cygnes National Wildlife Refuge summarizes
  refuge activities during the 2000 calendar year.  The report begins with a summary
  of the yearu2019s highlights and climatic conditions.   Land acquisition-including
  fee title, easements and other is also covered.  The report includes a planning
  section which discusses master plan, and research and investigations and other.
  \ Refuge administration is outlined; information about personnel, youth programs,
  volunteer programs, funding, safety, technical assistance and other items is given.
  \ Habitat management is also covered.  Subjects include wetlands, forests, cropland,
  grassland, other habitats, grazing, haying, fire management, pest control, and water
  rights.  The wildlife section of the report discusses endangered and/or threatened
  species, waterfowl, marsh and water birds, shorebirds, gulls, terns, and allied
  species, raptors, other migratory birds, game mammals, other residents wildlife,
  and fisheries resources.  The public uses of the refuge described in this report
  include general, outdoor student and teacher classrooms, interpretive foot trails,
  interpretive exhibits/demonstrations, hunting, fishing, trapping, wildlife observation,
  other wildlife oriented recreation, camping, picnicking, off road vehicling, other
  non-wildlife oriented recreation, law enforcement and cooperating associations.
  \ The equipment and facilities section of the report provides information about
  new construction, rehabilitation, equipment utilization and replacement, computer
  systems, and other.  Items of interest are provided at the end.\",\n\t\"owner_org\":
